B.OK=new A.bB("There are things you can do to reduce your own risk of developing dementia. These include keeping active, eating healthily and exercising your mind.\n",null,B.Md,null,null)
B.OQ=new A.bB("There is a lot of evidence that lifestyle choices can affect our risk of developing dementia. Dementia risk is lowest in people who have healthy behaviours in mid-life (aged 40\u201365). No single behaviour is guaranteed to prevent dementia, and some are more easy to change than others.",null,null,null,null)
B.bu=new A.l(!0,null,null,null,null,null,24,B.bE,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null)
B.OV=new A.bB("\n\nTake physical exercise",null,B.bu,null,null)
B.OO=new A.bB("Doing regular physical activity is one of the best ways to reduce your risk of dementia. It\u2019s good for your heart, circulation, weight and mental wellbeing.\n\nThere are two main types of physical activity \u2013 aerobic activity and strength-building activity. Each type will keep you fit in different ways. Doing a combination of these activities will help you to reduce your risk of dementia.",null,null,null,null)
B.OS=new A.bB("\n\nDrink less alcohol",null,B.bu,null,null)
B.Ow=new A.bB("Drinking too much alcohol increases your risk of developing dementia.\n\nIf you regularly drink alcohol, try to do so in moderation and within recommended limits. Drinking too much alcohol at one time exposes your brain to high levels of harmful chemicals.\n\nTry to drink no more than 14 units of alcohol each week. This is equal to about one pint of beer or a small glass of wine each day. If you regularly drink much more than this, you are increasing your risk of damage to your brain and other organs, and so increasing your risk of dementia.",null,null,null,null)
B.OJ=new A.bB("\n\nDon't smoke",null,B.bu,null,null)
B.OA=new A.bB("If you smoke, you\u2019re putting yourself at a much higher risk of developing dementia later in life.\n\nSmoking does a lot of harm to the circulation of blood around the body, particularly the blood vessels in the brain, as well as the heart and lungs.\n\nIt\u2019s never too late to quit smoking. The earlier you stop, the more brain damage you will avoid.",null,null,null,null)
B.OD=new A.bB("\n\nStay mentally well and socially active",null,B.bu,null,null)
B.OL=new A.bB("Depression is a mental health condition that affects at least one in five people in the UK. People who have had periods of depression in their life also have a higher risk of developing dementia.\n\nSocial isolation can greatly increase a person\u2019s risk of dementia. Engaging in social activities may help to build up your brain\u2019s ability to relieve stress and improve your mood.",null,null,null,null)
B.OF=new A.bB("\n\nManage long-term health conditions",null,B.bu,null,null)
B.OR=new A.bB("Certain health conditions, such as high blood pressure or diabetes, can increase the risk of getting dementia. An important way to manage this is by going for a health check.\n\nEating an unhealthy diet may also cause health problems, including obesity, which can be linked to an increased risk of dementia.",null,null,null,null)
B.OU=new A.bB("\n\nProtect your hearing",null,B.bu,null,null)
B.OH=new A.bB("Hearing loss is related to an increased risk of developing dementia and may be an early symptom.\n\nManaging hearing loss works best when you start doing it early on. You can avoid listening to loud noises for long periods and wear ear protection when necessary. The use of hearing aids has been shown to reduce the risk of dementia to the level of a person with normal hearing.",null,null,null,null)
B.OB=new A.bB("\n\nProtect your head",null,B.bu,null,null)
B.Ov=new A.bB("Traumatic brain injuries are caused by a blow or jolt to the head \u2013 especially when the person is knocked out unconscious. These can start a process in the brain where the substances that cause Alzheimer\u2019s disease build up around the injured area.\n\nWear protective headgear in situations where there is a higher-than-normal risk of head injury \u2013 for example, riding a bike, working on a building site, horse-riding or playing cricket.\n\nMore research is needed to fully understand the amount of long-term dementia risk involved in contact sports like rugby or football. It\u2019s important that coaching staff know how to deal with concussions and other head injuries.",null,null,null,null)
B.OM=new A.bB("\n\nEnvironmental risk factors",null,B.bu,null,null)
B.OE=new A.bB("Certain forms of air pollution increase a person\u2019s risk of dementia. It is difficult for an individual to reduce their exposure to polluted air and better environmental policies are needed to reduce air pollution.",null,null,null,null)
